var status = dsData[dsIndex]['log_type'];
var res="grey";
if(status=='dvr_nvr_on' || status=='intrusion_alarm_system_on' || status=='fire_alarm_system_on' || status=='time_lock_system_on' || status=='access_control_system_on' || status== 'time_lock_door_close' || status=='access_control_door_close' || status== 'intrusion_alarm_system_fault_condition_restored' || status== 'intrusion_alarm_system_activation_restored' || status== 'fire_alarm_system_fault_condition_restored' || status== 'camera_tampered_restored' || status=='camera_connection_established' || status=='hdd_error_restored' || status== 'time_lock_tamper_restored' || status=='access_control_system_tamper_restored' || status == 'heartbeat_BAS' || status == 'heartbeat_FAS' || status == 'heartbeat_CCTV' || status == 'heartbeat_time_lock' || status == 'heartbeat_access_control' || status == 'heartbeat'){
    res =  "green";
}else if(status =='intrusion_alarm_system_activate' || status=='fire_alarm_system_activate' || status== 'time_lock_door_open'|| status=='access_control_door_open' || status =='camera_disconnect' ){
    res = "red";
}
else if(status == 'intrusion_alarm_system_fault' || status=='fire_alarm_system_fault' || status== 'camera_tampered' || status =='hdd_error' || status== 'time_lock_tamper' || status=='access_control_system_tamper' ){
    res = "yellow";
}else if(status == 'intrusion_alarm_system_off' || status=='fire_alarm_system_off' || status == 'dvr_nvr_off' || status =='time_lock_system_off' || status== 'access_control_system_off'){
    res = "grey";
}
return res;

